let drawPulsar = createPulsar();

function setup() {
    createCanvas(800, 800).parent("pulsar");
    frameRate(60);
}

function draw() {
    background(0);
    drawPulsar(...['oscillationSpeed', 'maxRotation', 'rayLength', 'coreSize', 'centerX', 'centerY', 'rayWidth', 'motionBlurAmount', 'coreOscillationSpeed', 'rotationOffset'].map(id =>
    // drawPulsar(0.75, 10, 560, 50, 400, 400, 8, 1000, 5, 2.8);    
    parseFloat(document.getElementById(id).value)));

    document.getElementById('reset').onclick = function () {
        ['oscillationSpeed', 'maxRotation', 'rayLength', 'coreSize', 'centerX', 'centerY', 'rayWidth', 'motionBlurAmount', 'coreOscillationSpeed', 'rotationOffset'].forEach(id => {
            document.getElementById(id).value = { oscillationSpeed: 0.75, maxRotation: 10, rayLength: 560, coreSize: 50, centerX: 400, centerY: 400, rayWidth: 8, motionBlurAmount: 1000, coreOscillationSpeed: 5, rotationOffset: 2.8 }[id];
        });
    };
}

